export const styles = theme => ({
  container: {
    padding: theme.spacing.unit * 2,
  },
  title: {
    paddingBottom: 0,
  },
  textField: {
    width: '100%',
  },
  formControl: {
    margin: theme.spacing.unit,
    minWidth: 120,
  },
  wrapper: {
    marginTop: theme.spacing.unit * 2,
    display: 'flex',
    justifyContent: 'flex-end',
  },
  button: {
    minWidth: 100,
    minHeight: 48,
  },
});
